import './App.css';   
import Home from './components/Home';
import History from './components/History';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Shortnerresult from './components/Shortnerresult';
import { useState } from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import { Switch } from "react-router";



function App() {

  const [inputValue, setInputValue] = useState("");
  return (
    <div className="App">
        <BrowserRouter>
          <Navbar bg="light" expand="lg">
            <Container fluid>

              <Navbar.Toggle aria-controls="navbarScroll" />

                <Navbar.Collapse id="navbarScroll">
                    <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }} >           
                        <Nav.Link className='Home'>Home </Nav.Link>
                        <Link to="/" > Home </Link>
                        <Nav.Link className='History'> History </Nav.Link>
                        <Link to="/History" > History </Link>
                    </Nav> 
                </Navbar.Collapse>
            </Container>
          </Navbar>

          <div className="container">


          <Routes>

            <switch>
                    <Route path="/" element={<Home />} />
                    <Route path="/History" element={<History />} />
            </switch>
         </Routes>

          <Home setInputValue={setInputValue}/><br/><br/>
          <Shortnerresult inputValue={inputValue}/>

        </div>
        </BrowserRouter>
    </div>
  );
}

export default App;
